import React from 'react';
import ReactDOM from 'react-dom/client';



import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Layout from "./pages/Layout";
import Home from "./pages/Home";
import Blogs from "./pages/Blogs";
import Contact from "./pages/Contact";
import NoPage from "./pages/NoPage";
import Login from "./pages/forms/Login";

// for bootstrap
import bootstrap from "./pages/view/global/bootstrap/css/bootstrap.css"
import bootstrap_min from "./pages/view/global/bootstrap/css/bootstrap.min.css"
// for css
import login_style from "./pages/view/form/css/login.css"

// for images
import login_images from "./pages/view/form/img"


export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <Route index element={<Home />} />
          <Route path="home" element={<Blogs />} />
          <Route path="login" element={<Login />} />
          <Route path="*" element={<NoPage />} />
        </Route>
      </Routes>
    </BrowserRouter>

  );
}


const content = document.getElementById('root');
const root = ReactDOM.createRoot(content);
root.render(<App />);
